growing up my mom would stuff @incmagazine in our christmas stockings. i loved the entrepreneurs journey. most pro lacrosse players can relate — for years we did whatever we could to make it.

today we have bigger audiences, new sponsors, global media coverage and players with equity in the @pll.

we’re only at the beginning of our journey and i can’t stop thinking about what these features will look like over the next 10 years as a new class of players enter the pll and take the game to heights unseen. they’ll get the cover no doubt. 

thanks to everyone who made this feature happen. my mom and little self on christmas day would’ve been shook. 

