The origins of this game are shared through a traditional wooden stick. Jack Johnson of the Mohawk Nation begins with the hickory tree, bends it, shapes the walls with rawhide and strings it with leather.

History is shared through people like Chief Oren Lyons, a Faithkeeper of the Turtle Clan — former Syracuse lacrosse player and member of the Human Rights Commission at the UN.
 
This is America's oldest game. Created by the Haudenosaunee – whose oral traditions tell us the game was played between birds and mammals. They call it Dehontsigwaehs — which means “they bump hips.”
 
The rules were simple — you couldn’t touch the ball with your hands and there were no boundaries. The ball was tossed in the air to begin the match played on fields where goals might be trees, sometimes miles apart. Games were played to prepare for war, settle disputes, for recreation, and for spiritual purposes — that version known as the Medicine Game.
 
European settlers first saw lacrosse in 1636. Jean de Brébeuf sketched the stick and called the game “La Crosse”. By the 1860’s lacrosse was Canada’s national game with exhibitions played in England. The first World Championship was held in 1867 when Montreal challenged the Kahnawake — a First Nation of the Mohawk. Kahnawake won 3-2. Queen Victoria remarked that “the game is very pretty to watch.”
 
In 1904 lacrosse was played in the Olympics. In 1921 it was called “the fastest game on two feet” by a Baltimore Sun sportswriter. In 1962 Johns Hopkins star Jerry Schmidt graced the cover of Sports Illustrated as they dubbed it “the tough game.”
 
Today’s game is played in over 90 countries — from the US to Nicaragua, to Jamaica and Uganda, New Zealand, Japan and Hong Kong.
 
We hosted our Indigenous Heritage weekend in Minnesota — where the land and Great Lakes have been nurtured over the course of history so that wherever in the world you are, however you play the game, there will always be a connection to its past. I hope you can feel that.
 
There’s much to celebrate and be grateful for. 

